import React from "react";
import Item from './Item';
import './Links.css'
function Links(){
    return(
        <div className="linkhead">
            <div className="row">
         <a href="/link"><i class="linkbtn fab fa-staylinked fa-4x" ></i></a>
         </div>
         <div className="content">
          <Item title="HOME" link="/" />
          <Item title="KNOW ME" link="about"/>
          <Item title="COMPETITIVE STATS" link="comp"/>
          <Item title="PROJECTS" link="proj"/>
          <Item title="GET IN TOUCH!" link="contact"/>
          </div>
          </div>
    );
}

export default Links;
